import React from "react";

const Row = (props) => {
  return(
    <div className="row-cont">
      <div className="row-left">{props.text}</div>
      <div className="row-right">
        <div className="hex">{props.hexCodeClr}</div>
      </div>
    </div>
  );
}

export default Row;
